property.value:
if (element.getName().toLocaleLowerCase() === "content" || 
    element.getName().toLocaleLowerCase() === "filename" || 
    element.getName().toLocaleLowerCase() === "contenttype" || 
    element.getName().toLocaleLowerCase() === "contentlength") {
    return;
}

const fileTransferStereotype = "d30e48e8-389e-4b70-84fd-e3bac44cfe19";
const paramSettingsStereotype = "d01df110-1208-4af8-a913-92a49d219552";

const fieldParent = element.getParent();
if (fieldParent?.hasStereotype(fileTransferStereotype) && !element.hasStereotype(paramSettingsStereotype)) {
    element.addStereotype(paramSettingsStereotype);
}
